import { Link } from "react-router-dom";
const NavBarList = [
    {
        item: 'RESEARCH',
        link: '/research',
    },
    {
        item: 'CV',
        link: '/cv',
    },
    {
        item: 'TEACHING',
        link: '/teaching',
    },
];

function Navbar(): JSX.Element {

    return (
        <nav>
            <ul>
                {NavBarList.map((item) => {
                    (
                        <li key={item.item} >
                            <Link to={item.link}>{item.item}</Link>
                        </li>
                    )
                })}
            </ul>
        </nav>
    );
}

export default Navbar;
